export const clockColors = {
  colorWhenUsedForHoursAndMinutes:      'rgb(150, 120, 0)',   // lavender purple
  colorWhenUsedForHours :               'rgb(255,102,102)',   // coral pink
  colorWhenUsedForMinutes:              'rgb(0,128,128)',     // Teal blue
  colorWhenNotUsed:                     'white',              // white
  clockBackGroundColorArrayStartColor:  'rgb(118, 184, 42)',  // green
  clockBackGroundColorArrayEndColor:    'rgb(0, 179, 217)',   // blue
  secondsCounterArrayStartColor:        'rgb(118, 184, 42)',  // green
  secondsCounterArrayEndColor:          'rgb(0, 179, 217)'    // blue
}
